import { fetchStocksBegin, fetchStocksSuccess } from "./stockActions";
import Papa from 'papaparse';

export function fetchStockSearchData() {
  return dispatch => {
    dispatch(fetchStocksBegin());
    return fetch("./companylist.csv")
    .then(handleErrors)
    .then(res => res.text())
    .then(data => {
      const results = Papa.parse(data);
      console.log(results);
      // console.log(results.map((stock) => ({
      //   symbol: stock[0],
      //   name: stock[1],
      // })));
      // dispatch(fetchStocksSuccess(data));
    });
  }
}

export function handleErrors(response) {
  if (!response.ok) throw Error(response.statusText);
  return response;
}
